import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './components/AuthContext';
import Login from './components/Login';
import Register from './components/Register';
import Products from './components/product/Poducts';
import Createproduct from './components/product/CreateProduct';
import Profile from './components/profile/Profile';
import Incommingorder from './components/order/IncomingOrder';

function App() {
  const { isLoggedIn } = useAuth();
  return (
      <Router>
        <Routes>
          {window.location.hostname === 'localhost' && <Route path="/" element={<Navigate to="/login" />} />}
          {!isLoggedIn && <Route path="/" element={<Navigate to="/login" />} />}
          {!isLoggedIn && <Route path="/login" element={<Login />} />}
          {!isLoggedIn && <Route path="/register" element={<Register />} />}
          {isLoggedIn && <Route path="/product" element={<Products />} />}
          {isLoggedIn && <Route path="/create" element={<Createproduct />} />}
          {isLoggedIn && <Route path="/profile" element={<Profile />} />}
          {isLoggedIn && <Route path="/order" element={<Incommingorder />} />}
        </Routes>
      </Router>
  );
};

export default App;
